import React, { useState, useEffect } from 'react';
import {
  Box,
  Tabs,
  Tab,
  Typography,
  Paper,
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  Button,
  Dialog,
  DialogTitle,
  DialogContent,
  DialogActions,
  TextField,
  IconButton,
  Chip,
} from '@mui/material';
import {
  Edit as EditIcon,
  Delete as DeleteIcon,
  Comment as CommentIcon,
} from '@mui/icons-material';
import axios from 'axios';

const AdminPanel = () => {
  const [activeTab, setActiveTab] = useState(0);
  const [users, setUsers] = useState([]);
  const [policies, setPolicies] = useState([]);
  const [claims, setClaims] = useState([]);
  const [selectedItem, setSelectedItem] = useState(null);
  const [dialogOpen, setDialogOpen] = useState(false);
  const [commentDialogOpen, setCommentDialogOpen] = useState(false);
  const [comment, setComment] = useState('');
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');

  useEffect(() => {
    fetchData();
  }, [activeTab]);

  const fetchData = async () => {
    try {
      setLoading(true);
      switch (activeTab) {
        case 0:
          const usersRes = await axios.get('/api/admin/users');
          setUsers(usersRes.data);
          break;
        case 1:
          const policiesRes = await axios.get('/api/admin/policies');
          setPolicies(policiesRes.data);
          break;
        case 2:
          const claimsRes = await axios.get('/api/admin/claims');
          setClaims(claimsRes.data);
          break;
        default:
          break;
      }
    } catch (err) {
      setError('Failed to fetch data');
      console.error(err);
    } finally {
      setLoading(false);
    }
  };

  const handleTabChange = (event, newValue) => {
    setActiveTab(newValue);
  };

  const handleEdit = (item) => {
    setSelectedItem(item);
    setDialogOpen(true);
  };

  const handleDelete = async (id) => {
    try {
      switch (activeTab) {
        case 0:
          await axios.delete(`/api/admin/users/${id}`);
          setUsers(users.filter((user) => user.id !== id));
          break;
        case 1:
          await axios.delete(`/api/admin/policies/${id}`);
          setPolicies(policies.filter((policy) => policy.id !== id));
          break;
        case 2:
          await axios.delete(`/api/admin/claims/${id}`);
          setClaims(claims.filter((claim) => claim.id !== id));
          break;
        default:
          break;
      }
    } catch (err) {
      setError('Failed to delete item');
      console.error(err);
    }
  };

  const handleSave = async () => {
    try {
      switch (activeTab) {
        case 0:
          await axios.put(`/api/admin/users/${selectedItem.id}`, selectedItem);
          setUsers(users.map((user) => (user.id === selectedItem.id ? selectedItem : user)));
          break;
        case 1:
          await axios.put(`/api/admin/policies/${selectedItem.id}`, selectedItem);
          setPolicies(policies.map((policy) => (policy.id === selectedItem.id ? selectedItem : policy)));
          break;
        case 2:
          await axios.put(`/api/admin/claims/${selectedItem.id}`, selectedItem);
          setClaims(claims.map((claim) => (claim.id === selectedItem.id ? selectedItem : claim)));
          break;
        default:
          break;
      }
      setDialogOpen(false);
    } catch (err) {
      setError('Failed to update item');
      console.error(err);
    }
  };

  const handleAddComment = async () => {
    try {
      await axios.post(`/api/admin/claims/${selectedItem.id}/comments`, {
        comment,
      });
      setCommentDialogOpen(false);
      setComment('');
      fetchData();
    } catch (err) {
      setError('Failed to add comment');
      console.error(err);
    }
  };

  const getStatusColor = (status) => {
    switch (status.toLowerCase()) {
      case 'active':
      case 'approved':
        return 'success';
      case 'pending':
        return 'warning';
      case 'expired':
      case 'rejected':
        return 'error';
      default:
        return 'default';
    }
  };

  const renderUsersTable = () => (
    <TableContainer>
      <Table>
        <TableHead>
          <TableRow>
            <TableCell>Name</TableCell>
            <TableCell>Email</TableCell>
            <TableCell>Role</TableCell>
            <TableCell>Actions</TableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          {users.map((user) => (
            <TableRow key={user.id}>
              <TableCell>{`${user.firstName} ${user.lastName}`}</TableCell>
              <TableCell>{user.email}</TableCell>
              <TableCell>{user.role}</TableCell>
              <TableCell>
                <IconButton onClick={() => handleEdit(user)}>
                  <EditIcon />
                </IconButton>
                <IconButton onClick={() => handleDelete(user.id)}>
                  <DeleteIcon />
                </IconButton>
              </TableCell>
            </TableRow>
          ))}
        </TableBody>
      </Table>
    </TableContainer>
  );

  const renderPoliciesTable = () => (
    <TableContainer>
      <Table>
        <TableHead>
          <TableRow>
            <TableCell>Policy Number</TableCell>
            <TableCell>Type</TableCell>
            <TableCell>User</TableCell>
            <TableCell>Status</TableCell>
            <TableCell>Actions</TableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          {policies.map((policy) => (
            <TableRow key={policy.id}>
              <TableCell>{policy.policyNumber}</TableCell>
              <TableCell>{policy.type}</TableCell>
              <TableCell>{`${policy.user.firstName} ${policy.user.lastName}`}</TableCell>
              <TableCell>
                <Chip
                  label={policy.status}
                  color={getStatusColor(policy.status)}
                  size="small"
                />
              </TableCell>
              <TableCell>
                <IconButton onClick={() => handleEdit(policy)}>
                  <EditIcon />
                </IconButton>
                <IconButton onClick={() => handleDelete(policy.id)}>
                  <DeleteIcon />
                </IconButton>
              </TableCell>
            </TableRow>
          ))}
        </TableBody>
      </Table>
    </TableContainer>
  );

  const renderClaimsTable = () => (
    <TableContainer>
      <Table>
        <TableHead>
          <TableRow>
            <TableCell>Claim Number</TableCell>
            <TableCell>Policy Type</TableCell>
            <TableCell>User</TableCell>
            <TableCell>Status</TableCell>
            <TableCell>Actions</TableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          {claims.map((claim) => (
            <TableRow key={claim.id}>
              <TableCell>{claim.claimNumber}</TableCell>
              <TableCell>{claim.policyType}</TableCell>
              <TableCell>{`${claim.user.firstName} ${claim.user.lastName}`}</TableCell>
              <TableCell>
                <Chip
                  label={claim.status}
                  color={getStatusColor(claim.status)}
                  size="small"
                />
              </TableCell>
              <TableCell>
                <IconButton onClick={() => handleEdit(claim)}>
                  <EditIcon />
                </IconButton>
                <IconButton onClick={() => {
                  setSelectedItem(claim);
                  setCommentDialogOpen(true);
                }}>
                  <CommentIcon />
                </IconButton>
              </TableCell>
            </TableRow>
          ))}
        </TableBody>
      </Table>
    </TableContainer>
  );

  return (
    <Box>
      <Typography variant="h4" gutterBottom>
        Admin Panel
      </Typography>

      <Paper sx={{ width: '100%', mb: 2 }}>
        <Tabs
          value={activeTab}
          onChange={handleTabChange}
          indicatorColor="primary"
          textColor="primary"
        >
          <Tab label="Users" />
          <Tab label="Policies" />
          <Tab label="Claims" />
        </Tabs>
      </Paper>

      {loading ? (
        <Typography>Loading...</Typography>
      ) : error ? (
        <Typography color="error">{error}</Typography>
      ) : (
        <Paper sx={{ width: '100%', overflow: 'hidden' }}>
          {activeTab === 0 && renderUsersTable()}
          {activeTab === 1 && renderPoliciesTable()}
          {activeTab === 2 && renderClaimsTable()}
        </Paper>
      )}

      {/* Edit Dialog */}
      <Dialog open={dialogOpen} onClose={() => setDialogOpen(false)}>
        <DialogTitle>Edit {activeTab === 0 ? 'User' : activeTab === 1 ? 'Policy' : 'Claim'}</DialogTitle>
        <DialogContent>
          {selectedItem && (
            <Box sx={{ pt: 2 }}>
              {Object.entries(selectedItem)
                .filter(([key]) => !['id', 'createdAt', 'updatedAt'].includes(key))
                .map(([key, value]) => (
                  <TextField
                    key={key}
                    label={key.charAt(0).toUpperCase() + key.slice(1)}
                    value={value}
                    onChange={(e) =>
                      setSelectedItem({ ...selectedItem, [key]: e.target.value })
                    }
                    fullWidth
                    margin="normal"
                  />
                ))}
            </Box>
          )}
        </DialogContent>
        <DialogActions>
          <Button onClick={() => setDialogOpen(false)}>Cancel</Button>
          <Button onClick={handleSave} variant="contained">
            Save
          </Button>
        </DialogActions>
      </Dialog>

      {/* Comment Dialog */}
      <Dialog open={commentDialogOpen} onClose={() => setCommentDialogOpen(false)}>
        <DialogTitle>Add Comment</DialogTitle>
        <DialogContent>
          <TextField
            label="Comment"
            value={comment}
            onChange={(e) => setComment(e.target.value)}
            fullWidth
            multiline
            rows={4}
            margin="normal"
          />
        </DialogContent>
        <DialogActions>
          <Button onClick={() => setCommentDialogOpen(false)}>Cancel</Button>
          <Button onClick={handleAddComment} variant="contained">
            Add Comment
          </Button>
        </DialogActions>
      </Dialog>
    </Box>
  );
};

export default AdminPanel;
